The field dependency defines the dependencies of a module. It should look like the following: { // .. dependency { foo { digest "(base64url-encoded sha256 checksum)", mirror [ "URL-1", // .. "URL-N", ], enable-preset <true | false>, // ← optional field }, // .. bar { .. }, }, // ..
} An example of dependency: { // .. dependency { core { digest "ub3MUXVac9F1rebIhl_Crm2_GJ7PzCAekgp8aYH3-mo", mirror [ "https://github.com/vekatze/neut-core/raw/main/archive/0-38.tar.zst", ], enable-preset true, }, some-package { digest "F_ST8PtL9dLCDWVZ4GpuS7sviUU0_-TUz2s6iw-86KU", mirror [ "https://example.com/foobarbuz/packages/22-3.tar.zst", ], }, }, // ..
} The field digest specifies the checksum of the tarball of the dependency. The digest is a Base64URL-encoded SHA256 checksum of the tarball. This digest is the "real" name of this dependency, and used as an identifier. The field mirror specifies a list of URLs from which the compiler can fetch the tarball. When running neut get, the compiler will try to get the tarball if necessary, using this list from the beginning to the end. The optional field enable-preset specifies whether to import presets automatically, as in "prelude" in other languages. This field should only be used (and set to be true) with the core library. For more information, see the explanation of preset in this section. The field dependency is optional. The default value of dependency is {}.

