The field static defines the list of static files that can be embedded into source files at compile time. It should look like the following: { // .. static { some-file "relative/path/from/the/module/root/to/some-file.txt", other-file "relative/path/from/the/module/root/to/other-file.txt", }, // ..
} You can use the keys defined here in source files using import and include-text: // foo.nt import { // .. static {some-file, other-file} // ..
} define use-some-file(): unit { let t1: &text = include-text(some-file); let t2: &text = include-text(other-file); print(t1); print(t2)
} After specifying a key of a static source file in import, you can use it in include-text to embed the file's content to the source file at compile time. Here, include-text assumes that the encoding of the static file is UTF-8. The compiler triggers recompilation when necessary by comparing the modification times of static resources and source files. In the code above, for example, the compiler recompiles foo.nt if you modify the content of some-file.txt. The field static is optional. The default value of static is {}.

