The field preset defines the list of names that must be imported implicitly when the module is used as a dependency. It should look like the following: { // .. preset { foo ["my-func", "other-func"], item.bar ["hoge", "pohe"], }, // ..
} In the example above, the current module is expected to have the following files: (source-dir)/foo.nt that contains the definitions of my-func and other-func (source-dir)/item/bar.nt that contains the definitions of hoge and pohe The field preset is used in combination with enable-preset in dependency. Suppose we released a module that contains the definition of preset as in the above. Also, suppose someone is developing a module MMM and they added our module to MMM's dependency: // module.ens in MMM { // .. dependency { sample { digest "BASE64_URL_ENCODED_SHA256_CHECKSUM", mirror ["SOME_URL"], enable-preset true, }, // .. }, // ..
} In this case, source files in MMM imports our preset names automatically since enable-preset is true. As an example, suppose a file in MMM contains an import like the following: import { sample.foo {my-func},
} define buz(): int { let i = my-func(); add-int(i, 10)
} This code is the same as the following since the preset is enabled: define buz(): int { let i = my-func(); add-int(i, 10)
} The field preset is expected to be used as a way to realize "preludes" in other languages. The field preset is optional. The default value of preset is {}.

