import imports names from other files. It should look like the following: import { Qux, ZZ, sample.buz, this.foo, this.foo.bar {some-func, other-func},
} import can only be at the top of a file. Every item in import is something like the following: this.foo this.foo.bar {some-func, other-func} sample.buz An import item starts from the alias of the module (this, sample). The alias of the module is specified in dependency in module.ens. If the file we want to import is inside the current module, we'll write this. The remaining part of the item is the relative path from the source directory. For example, if we want to import (source-dir)/foo/bar, we'll have to write foo.bar after the alias of the module. An import item can be constructed by concatenating the alias and the path with .. In the case of this.foo.bar, the alias part is this, and the path part is foo.bar. You can specify names in {}. The names specified here can be used without qualifiers: import { this.foo.bar {some-func},
} define yo(): unit { some-func(arg-1, arg-2)
} Unlisted names must be qualified: import { this.foo.bar,
} define yo(): unit { this.foo.bar.some-func(arg-1, arg-2)
} You can also list static files in import: import { static {some-file, other-file}
} For more on static files, please see the section in Modules .

