define defines a function. It should look like the following: define foo(x: int, y: int): int { add-int(x, y)
} define identity-1(a: type, x: a): a { x
} // a function with an implicit parameter
define identity-2<a>(x: a): a { x
} Defined functions can then be used: define use-foo(): int { foo(1, 2)
} define can optionally have implicit parameters, as in identity-2 in the above example. The compiler inserts these implicit parameters at compile time, so you don't have to write them explicitly: define use-func-with-implicit-arg(): int { let x = 10; let y = identity-1(int, x); // ← explicit version let z = identity-2(x); // ← implicit version z
} You can also use define without any explicit parameters: define foo: int { 10
} define empty-list<a>: list(a) { Nil
} define use-constants(): list(int) { let x = foo; empty-list
} The above code is translated into the following during compile time: define foo(): int { 10
} define empty-list<a>(): list(a) { Nil
} define use-constants(): list(int) { let x = foo(); empty-list()
} The compiler tries to reduce the body of a define into a value at compile time if the define doesn't have any explicit parameters. The compiler reports an error if it can't get a value. For example, the following should result in an error: define bar: int { print("hello"); 123
} A function with the same name can't be defined in the same file. All the tail-recursions in Neut are optimized into loops (thanks to geniuses in the LLVM team). Note that statements are order-sensitive as in F#. Thus, the following code results in an error: define bar(): int { foo() // `foo` is undefined here
} define foo(): int { 10
} You have to use the statement nominal explicitly for forward references.

