resource defines a new type by specifying how to discard/copy the values of the type. It should look like the following: resource my-type { function (value: pointer) { // .. discard the value .. }, function (value: pointer) { // .. create a new clone of the value and return it as int .. }, tag, // integer value
} resource takes three terms. The first term ("discarder") receives a value of the type and discards it. The second term ("copier") receives a value of the type and returns a clone of the value (keeping the original value intact). The third term is a tag that is returned when calling magic call-type(my-type, 2, (..)). The type of a discarder is (a) -> unit for some a. You might want to call functions like free in this term. The type of a copier is (a) -> a for some a. This a must be the same as the a used in the discarder. You might want to call functions like malloc in this term. The type of a tag is int. See also: Semantics (call-type) For example, the following is a definition of a "boxed" integer type with some noisy messages: resource boxed-int { // discarder: (pointer) -> unit function (v: pointer) { print("discarded!\n"); free(v) }, // copier: (pointer) -> pointer function (v: pointer) { let orig-value = load-int(v); let new-ptr = malloc(1); magic store(int, orig-value, new-ptr); new-ptr }, // You should use `type-tag-to-int(Opaque)` as long as the structure of your // resource type isn't the same as one of the `type-tag` values defined in `core.type-tag`. // If your resource type has the same structure as one of the `type-tag` values, you can // use something like `type-tag-to-int(Int32)` so it can be, for example, // printed using `core.debug.vet: (&a) -> unit`. type-tag-to-int(Opaque),
} // provide a way to introduce new boxed integer
define create-new-boxed-int(x: int): boxed-int { let new-ptr = malloc(8); store-int(x, new-ptr); magic cast(int, boxed-int, new-ptr)
} A value of type boxed-int prints "discarded!\n" when the value is discarded. resource can be used to define low-level types like arrays. You can find an example usage of resource in the binary.nt in the core library .

