nominal declares functions for forward references. It should look like the following: nominal { is-odd(x: int): int,
} An entry of nominal is the same form as found in define. Nominal definitions can be used to achieve mutual recursions: nominal { is-odd(x: int): int, // nominal definition of `is-odd`
} // given a non-negative integer `x`, returns true if `x` is even.
define is-even(x: int): bool { if eq-int(x, 0) { True } else { is-odd(sub-int(x, 1)) // ← using nominal definition }
} // given a non-negative integer `x`, returns true if `x` is odd.
// ("real" definition of `is-odd`)
define is-odd(x: int): bool { if eq-int(x, 0) { False } else { is-even(sub-int(x, 1)) }
} If a nominal definition isn't followed by a real definition, the compiler reports an error.

