foreign declares functions that are defined in linked objects. It should look like the following: foreign { neut_myapp_v1_add_const(int): int,
} Foreign functions declared here can be called by using magic external(..). Suppose that you have a C source file with the following definition: // add_const.c int64_t neut_myapp_v1_add_const(int64_t value) { return value + 100;
} You can add the field foreign to your module.ens to compile and link this C source file, as written here . Under this setting, the following code can utilize neut_myapp_v1_add_const: foreign { neut_myapp_v1_add_const(int): int,
} define my-func(): int { let x: int = 10; magic external neut_myapp_v1_add_const(x)
} An example project that uses foreign can be found here . You can also use LLVM intrinsics. For example, the LLVM langref states that llvm.sin.* intrinsic is available : declare float @llvm.sin.f32(float %Val)
declare double @llvm.sin.f64(double %Val)
declare x86_fp80 @llvm.sin.f80(x86_fp80 %Val)
declare fp128 @llvm.sin.f128(fp128 %Val)
declare ppc_fp128 @llvm.sin.ppcf128(ppc_fp128 %Val) Thus, the next is a valid use of foreign: foreign { llvm.sin.f64(float): float,
} define sin(x: float): float { magic external llvm.sin.f64(x)
} Syscall wrapper functions and library functions are also available: foreign { exit(c-int): void, sleep(c-int): c-int,
} Here, the definition of c-int is as follows: inline _c-int: type { introspect architecture { | amd64 => int32 | arm64 => int32 }
} data c-int {
| C-Int(_c-int)
} The type of each parameter in every foreign entry must be a term that compiles to one of int{N}, float{N}, or pointer during compilation. For example, the c-int in exit(c-int): void is valid because it compiles to int32 (thanks to an optimization like Haskell's newtype). The resulting type of every foreign entry must be void or a term that compiles to one of int{N}, float{N}, or pointer during compilation. When declaring a variadic function, declare only the non-variadic part: foreign { printf(pointer): void,
} Then, specify the types of variadic arguments when using magic external: define print(t: &text): unit { // .. magic external printf(fmt)(len: int, val: pointer) // ^^^^^^^^^^^^^^^^^^^^^^ // passing variadic arguments with types
}

