Neut translates a type into a function that can discard/copy the values of the type. By using those functions, the compiler translates programs so that every variable is used exactly once. For example, if a variable is used twice, a translation like the following happens: // (before)
let xs: list(a) = List[value-1, value-2];
some-func(xs, xs) // `xs` is used twice // ↓ // (after)
let xs: list(a) = List[value-1, value-2];
let (xs1, xs2) = copy-list-a(xs); // `xs` is used once
some-func(xs1, xs2) If you need more information, see How to Execute Types . You might wonder: "So do I have to, for example, copy an entire list just to get its length? Isn't that a tragedy?" . This topic is covered in Static Memory Management and Modality and Memory . As written there, Neut avoids such copy operations by using the box modality , achieving something like borrowing in Rust.

