Thanks to its static nature, memory allocation in Neut can sometimes be optimized away. Consider the following code: data int-list {
| Nil
| Cons(int, int-list)
} // [1, 5, 9] => [2, 6, 10]
define increment(xs: int-list): int-list { match xs { | Nil => Nil // ↓ the `Cons` clause | Cons(x, rest) => Cons(add-int(x, 1), increment(rest)) }
} The expected behavior of the Cons clause above would be something like the following: obtain x and rest from xs free the outer tuple of xs calculate add-int(x, 1) and increment(rest) allocate memory region using malloc to return the result store the calculated values to the pointer and return it However, since the size of Cons(x, rest) and Cons(add-int(x, 1), increment(rest)) are known to be the same at compile-time, the pair of free and malloc should be able to be optimized away, as follows: obtain x and rest from xs calculate add-int(x, 1) and increment(rest) store the calculated values to xs (overwrite) And Neut does this optimization. When a free is required, Neut looks for a malloc that is the same size and optimizes away such a pair if one exists. The resulting assembly code thus performs in-place updates.

