This optimization "penetrates" branching. For example, consider the following: // (an `insert` function in bubble sort)
define insert(v: int, xs: int-list): int-list { match xs { | Nil => // ... | Cons(y, ys) => // (X) if gt-int(v, y) { Cons(y, insert(v, ys)) // (Y) } else { Cons(v, Cons(y, ys)) // (Z) } }
} At point (X), free against xs is required. However, this free can be canceled since mallocs of the same size can be found in all the possible branches (here, (Y) and (Z)). Thus, in the code above, the deallocation of xs at (X) is removed, and the memory region of xs is reused at (Y) and (Z), resulting in an in-place update of xs. On the other hand, consider rewriting the code above into something like the following: define foo(v: int, xs: int-list): int-list { match xs { | Nil => // ... | Cons(y, ys) => // (X') if gt-int(v, y) { Nil // (Y') } else { Cons(v, Cons(y, ys)) // (Z') } }
} At this time, the free against xs at (X') can't be optimized away since there exists a branch (namely, (Y')) that doesn't perform malloc that is of the same size as xs.

