In Neut, the content of a variable is copied if the variable is used more than once. For example, consider the following code: // before compilation (pseudo code)
define foo(xs: list(int)): list(int) { let ys = xs; // using `xs` (1) let zs = xs; // using `xs` (2) some-func(ys); other-func(zs); xs // using `xs` (3)
} In the code above, xs is used three times. Therefore, its content is copied twice: // after compilation (pseudo-code)
define foo(xs: list(int)): list(int) { let xs1 = COPY(list(int), xs); let xs2 = COPY(list(int), xs); let ys = xs1; let zs = xs2; some-func(ys); other-func(zs); xs
} Also, the content of a variable is discarded if the variable isn't used. For example, consider the following code: // before compilation
define bar(xs: list(int)): unit { Unit
} In the code above, xs isn't used. Therefore, its content is discarded: // after compilation (pseudo-code)
define bar(xs: list(int)): unit { DISCARD(list(int), xs); Unit
} Ignoring the arguments to COPY, this translation ensures that each variable occurs linearly (i.e., exactly once). This forms the basis of memory management in Neut. If you're interested in how Neut implements this translation, see How to Execute Types .

