ADTs like the below also have resource exponentials, of course: data list(a) {
| Nil
| Cons(a, list(a))
} The first thing to note is that the values of an ADT must be able to be discarded/copied using a closed function (since all the types in Neut are compiled into closed functions). This means the information about a in list(a) must be contained in the values. That is, for example, the internal representation of Nil is something like below: (a, 0) Here, the 0 is the discriminant for Nil. Also, that of Cons(10, xs) is: (a, 1, 10, xs) Here, the 1 is the discriminant for Cons. With that in mind, the resource exponential of list(a) will be something like the below (A bit lengthy; Skip it and just read the succeeding note if you aren't that interested in details): define exp-list(selector, v) { if selector == 0 { let d = get-discriminant(v); if d == 0 { // discard Nil free(v) } else { // discard Cons let a = v[0]; let cons-head = v[1]; let cons-tail = v[2]; free(v); let () = a(0, v[1]); // ← discard the head of cons using v[0] exp-list(0, v[2]) } } else { let d = get-discriminant(v); if d == 0 { // copy Nil let ptr = malloc({2-words}); let a = v[0]; store(ptr[0], a); store(ptr[1], d); ptr } else { // copy Cons let ptr = malloc({4-words}); let a = v[0]; let cons-head-copy = a(1, v[2]); // ← copy the head of cons using v[0] let cons-tail-copy = exp-list(1, v[3]); store(ptr[0], a); store(ptr[1], d); store(ptr[2], cons-head-copy); store(ptr[3], cons-tail-copy); ptr } }
} The point is that the type information in a value is loaded at runtime and used to discard/copy values . This utilization of types is the main point of first-class types in Neut. The main part of this section is now over. What follows is for curious cats.

