The compiler exploits Neut's static nature to reuse memory. Consider the following code: data int-list {
| Nil
| Cons(int, int-list)
} // [1, 5, 9] => [2, 6, 10]
define increment(xs: int-list): int-list { match xs { | Nil => Nil | Cons(y, ys) => let foo = add-int(y, 1); let bar = increment(ys); Cons(foo, bar) }
} The naive behavior of the Cons clause in the match would be something like the following: Extract y and ys from Cons(y, ys) free the outer tuple of Cons(y, ys) Calculate foo and bar Allocate memory region using malloc to represent the tuple of Cons(foo, bar) Store the calculated values to the pointer and return it Now, note that: the outer tuple of Cons(y, ys) will never be used after extracting its contents, and that the outer tuples of Cons(y, ys) and Cons(foo, bar) have the same size. Using this knowledge, the compiler translates given code so that it reuses the memory region of Cons(y, ys). More specifically, this Cons clause behaves as follows: Obtain y and ys from Cons(y, ys) Calculate foo and bar Store the calculated values to Cons(y, ys) In other words, when a free is required, the compiler looks for a malloc in the continuation that is the same size and optimizes away such a pair if one exists. The resulting assembly code thus performs in-place updates.

