Suppose we've defined a function length as follows: define length(xs: list(int)): int { match xs { | Nil => 0 | Cons(_, ys) => add-int(1, length(ys)) }
} Now, consider the following code: define use-length(!xs: list(int)): unit { let len = length(!xs); some-function(len, !xs)
} Note that the variable !xs is used twice. This means that the content of !xs is copied just to calculate its length. This is of course unfortunate. Worse, this kind of procedure isn't rare. We need some kind of loophole. Luckily, Neut has a remedy for this kind of situation, as we'll see below.

