We can create a noema using on: define use-length(xs: list(int)): unit { // xs: list(int) let len on xs = // xs: &list(int) length(xs); // xs: list(int) some-function(len, xs)
} on takes a comma-separated list of variables. The variables in the list (xs in this example) are cast to noema types in the body of the let, and cast back to the original types in the continuation. Conceptually, on can be seen as the following syntactic sugar: let v on x = e;
cont // ↓ desugar let x = unsafe-cast(a, &a, x); // cast: `a` ~> `&a`
let v = e; // (use `&a` in `e`)
let x = unsafe-cast(&a, a, x); // uncast: `&a` ~> `a`
cont on has to satisfy certain condition. Consider the following code: // xs: list(int)
// ...
let ys on xs = xs;
let _ = xs; // (*)
cont Since xs is discarded at (*), using ys in cont should result in use-after-free. To prevent this kind of behavior, the compiler rejects code that might contain any noema in the result of on. In this case, since the type of ys is &list(int), the compiler rejects this code. This condition might initially appear a bit artificial. In the next section, however, we'll see that it can in fact be understood via modal logic.

