If t is an ADT, you can view the content of a value e: &t using case: define length(xs: &list(int)): int { case xs { | Nil => 0 | Cons(_, ys) => add-int(1, length(ys)) }
} case is similar to match. The difference is that, unlike match, case doesn't perform free on its arguments. You can think of case as a read-only version of match. Also, note that the newly-bound variables in case are wrapped in &(_). In the code above, for example, the type of ys is not list(int), but &list(int). Now, we have new implementations of length and use-length: define length(xs: &list(int)): int { case xs { | Nil => 0 | Cons(_, ys) => add-int(1, length(ys)) }
} define use-length(xs: list(int)): unit { let len on xs = length(xs); some-function(len, xs)
} The code doesn't copy xs anymore, as you can see from the fact that it no longer contains !.

