Every term in Neut has an integer called layer. Conceptually, a layer can be seen as the level at which a piece of data lives. The body of a define starts at layer 0: define foo(): () -> unit { // here is layer 0 function () { // here is also layer 0 Unit }
} A variable defined at layer n can only be used at the same layer. For example, the following code is invalid because the variable x is defined at layer 0 but used at layer 3: define bar(): unit { // here is layer 0 let x = Unit; // ← `x` is defined at layer 0 ... // ← some layer operations here // layer 3 (for example) let v2 = x; // ← Error: `x` is used at layer 3 (≠ 0) ...
} Only modality-related operations can change layers, as we'll see below.

