To create a term of type meta a, use box: define use-box(x: &int, y: &bool, z: &text): meta pair(int, bool) { // here is layer 0 // free variables: // - x: &int // - y: &bool // - z: &text box x, y { // here is layer -1 (== layer(outer) - 1) // free variables: // - x: int // - y: bool // - (z is unavailable here because of layer mismatch) Pair(x, y) }
} Some notes on box: The type of xi in box x1, ..., xn {e} must be of the form &ai. Given xi: &ai, the type of xi in the body of box is ai. box behaves as follows: box x1, ..., xn { e } ↓ // (compile) let x1 = COPY(a1, x1);
...
let xn = COPY(an, xn);
e You can omit the sequence x1, ..., xn entirely if no variables need to be copied.

