There's one last rule that must be satisfied for memory safety. That is, if a function is defined at layer n, then any free variable x in the function must satisfy layer(x) <= n. Without this rule, you could do something like the following: define joker(): () -> unit { // layer 0 let xs: list(int) = List[1, 2, 3]; letbox-T f on xs = { // layer 0 box { // layer -1 function () { // ★ letbox k = { // layer 0 let len = length(xs); box {Unit} }; Unit } } }; f // function with xs: &list(int) as a free variable // FREE(xs)
} define main(): unit { let f = joker(); f(); // xs used after freed here
} This example would wrongly allow a function at layer 0 (★) to keep a reference to data (xs) that, after the outer letbox completes, could be deallocated, leading to a use-after-free scenario in the body of the main function. Hence, Neut’s layer rules prohibit capturing a higher-layer variable in a lower-layer function.

