The following function parses data and stores backups of said data. define backup-parse<a>(transformer: (binary) -> a): a { let !input: binary = get-next-input(); write-to-file(input-backup, bin-to-hex(!input)); // !input copied transformer(!input)
} This function might get slow if huge chunks of data are processed due to the copy. Rewriting it to use noetic values could look like the following: define backup-parse<a>(transformer: (&binary) -> a): a { let input: binary = get-next-input(); let result on binary = { write-to-file(input-backup, bin-to-hex(input)); // bin-to-hex takes a &binary now, avoiding the copy transformer(binary) }; result
} This won't compile because transformer contains a free variable a. This works as a safety guard, it compiled the following scenario would be possible: define id-bin(arg: &binary): &binary { arg
} define backup-parse<a>(transformer: (&binary) -> a): a { let input: binary = get-next-input(); let result on binary = { write-to-file(input-backup, bin-to-hex(input)); transformer(binary) }; result // FREE(input)
} define zen(): unit { let joker = backup-parse(id-bin); write-to-file(somefile, bin-to-hex(joker)); Unit
} The following happens inside zen: backup-parse(id-bin) evaluates to a reference to (the freed) input joker holds the (dangling) reference bin-to-hex takes joker as an argument, causing an use-after-free To fancy the requirements of the type system meta must be used as follows. define backup-parse<a>(transformer: (&binary) -> meta a): a { let input: binary = get-next-input(); letbox-T result on binary = { write-to-file(input-backup, bin-to-hex(input)); transformer(binary) }; result // FREE(input)
} The meta specifier asserts that the value a call to transformer evaluates will be valid on the outer layer (in this case the layer of zen, since it's where backup-parse has been called). The requirements of the operators that lift values into meta guarantee that this is the case. In order to make the previous example work, id-bin could look like the following: define id-bin(arg: &binary): meta binary { box arg { // *arg copied arg }
} define backup-parse<a>(transformer: (&binary) -> a): a { let input: binary = get-next-input(); let result on binary = { write-to-file(input-backup, bin-to-hex(input)); transformer(binary) }; result // FREE(input)
} define zen(): unit { let joker = backup-parse(id-bin); let _ on joker = write-to-file(somefile, bin-to-hex(joker)); Unit
} Lastly, to avoid the newly introduced copy, the following refactor is possible: define write-to-somefile(arg: &binary): meta unit { // used to be id-bin write-to-file(somefile, bin-to-hex(arg)); box {Unit}
} define backup-parse<a>(transformer: (&binary) -> a): a { let input: binary = get-next-input(); let result on binary = { write-to-file(input-backup, bin-to-hex(input)); transformer(binary) }; result // FREE(input)
} define zen(): unit { backup-parse(write-to-somefile)
}

