Suppose that you created a new function deep inside your module. You can technically create a test function for the function and check its behavior. Or modify the main function to call the new function just to see its behavior. It might be, however, a bit cumbersome. We'd love to achieve rapid try-and-error cycles in certain circumstances. You can use the command zen here. Suppose that a file some-file.nt contains a function foo that is defined as in the below: define foo(x: int): int { do-complex-calculation(x)
