The field target defines the entry points of a module. It should look like the following: { // .. target { TARGET-1 { main "path/to/source/file-1.nt" }, // .. TARGET-N { main "path/to/source/file-n.nt" }, }, // ..
} Suppose that your module has the following target in module.ens: { // .. target { foo { main "foo.nt", }, bar { main "item/yo.nt" }, }, // ..
} In this case, your module has two targets: foo and bar. The entry point of foo is the main function in (source-dir)/foo.nt. The entry point of bar is the main function in (source-dir)/item/yo.nt. The names in target can be specified when running neut build. For example, given the above definition of target, you can run neut build foo. The names of targets are also used as the names of executables. For example, if you run neut build foo --install ./bin/, an executable named foo will be created under the directory ./bin/. The field target is optional. The default value of target is {}.
